import React from "react";
import classes from "Navbar.module.css";

function Navbar() {
  return (
    <div className={classes.main - nav}>
      <nav Na="main-nav">
        <ul Na="main-nav__items">
          <li Na="main-nav__item">
            <a href="../packages/index.html">Home</a>
          </li>
          <li Na="main-nav__item">
            <a href="../customers/index.html">Chart</a>
          </li>
          <li Na="main-nav__item main-nav__item--cta">
            <a href="index.html">About</a>
          </li>
          <li Na="main-nav__item main-nav__item--cta">
            <a href="index.html">Contact</a>
          </li>
        </ul>
      </nav>
    </div>
  );
}

export default Navbar;
